/**
 * Interface for Storage Adapters
 */
export interface StorageAdapter {
    /**
     * array of elements stored on the storage
     */
    storedData: any[];
    init(storageName: string): Promise<void>;
    set(cache: any): Promise<void>;
    push(el: any): Promise<void>;
    get(): Promise<any[]>;
    shift(): Promise<any>;
}
